def solve(arr):
    i = 0
    while i < len(arr):
        if arr[i] == 0:
            arr.pop(i)
            arr.append(0)
        else:
            i += 1
    return arr

def solve(arr):
    zero_count = 0
    for i in range(len(arr)):
        if arr[i] == 0:
            zero_count += 1
        else:
            arr[i-zero_count] = arr[i]
    for i in range(len(arr)-zero_count,len(arr)):
        arr[i] = 0

def solve(array):
    zeroes = []
    non_zeroes = []
    for i in range(len(array)):
        if array[i] == 0:
            zeroes.append(array[i])
        else:
            non_zeroes.append(array[i])
    return non_zeroes + zeroes

def solve(nums):
    zeros = []
    non_zeros = []

    for num in nums:
        if num == 0:
            zeros.append(num)
        else:
            non_zeros.append(num)

    return non_zeros + zeros
